import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';
import "./styles/ScientistCard.css"; // ðŸ‘ˆ don't forget this line

function ScientistCard({ name, period, contribution, image }) {
  return (
    <Card className="card-fixed m-3 shadow">
      <Card.Img variant="top" src={image} />
      <Card.Body>
        <Card.Title>{name}</Card.Title>
        <Card.Subtitle className="mb-2 text-muted">{period}</Card.Subtitle>
        <Card.Text>{contribution}</Card.Text>
        <Button variant="">Learn More</Button>
      </Card.Body>
    </Card>
  );
}

export default ScientistCard;
